import React from 'react';
import './App.css'; 
import HomePage from './components/HomePage';
import AboutPage from './components/AboutPage';
import ContactPage from './components/ContactPage';
import DUISPage from './components/DUISPage';
import CriminalDefencePage from './components/CriminalDefencePage';
import PersonalInjuryPage from './components/PersonalInjuryPage';
import { Route } from 'react-router-dom';
import NavBar from './components/NavBar';


function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <React.Fragment>
        <Route exact path='/' to={HomePage}/>
        <Route exact path='/about' to={AboutPage}/>
        <Route exact path='/contact' to={ContactPage}/>
        <Route exact path='/duis' to={DUISPage}/>
        <Route exact path='/personalInjury' to={PersonalInjuryPage}/>
        <Route exact path='/criminalDefence' to={CriminalDefencePage}/>
      </React.Fragment>
    </div>
  );
}

export default App;
